import React from 'react';
// import googleImg from '../assets/google.png';
// import facebookImg from '../assets/facebook.png';

import {googleImg, facebookImg} from "../assets"
import { Image } from 'react-bootstrap';

const LoginForm = () => {
  return (
    <div>
      <button className="btn btn-outline-secondary btn-lg w-100 mb-3">
        <Image src={googleImg} style={{ maxWidth: '30px', marginRight: '10px' }} />{' '}
        Kontynuuj przy użyciu konta Google
      </button>
      <button className="btn btn-outline-secondary btn-lg w-100 mb-3">
        <Image src={facebookImg} style={{ maxWidth: '30px', marginRight: '10px' }} />{' '}
        Kontynuuj przy użyciu konta Google
      </button>
    </div>
  );
}

export default LoginForm;
